import { Injectable } from '@angular/core';
import { BilansPeriodiquePrevu } from '../models/BilansPeriodiquePrevu';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class BilansPeriodiquePrevuService {

  private apiUrl = 'https://localhost:7129/api/BilansPeriodiquePrevus';

  constructor(private http: HttpClient) { }
  addbp(BilansPeriodiquePrevu: BilansPeriodiquePrevu): Observable<any> {
    console.log('Creating it with data:', BilansPeriodiquePrevu);

    return this.http.post(`${this.apiUrl}/addbp`, BilansPeriodiquePrevu, { observe: 'response' , responseType: 'text'});
  }
  getById(id: number): Observable<BilansPeriodiquePrevu> {
    return this.http.get<any>(`${this.apiUrl}/${id}`);
  }

  update(id: number, BilansPeriodiquePrevu: BilansPeriodiquePrevu): Observable<any> {
    return this.http.put(`${this.apiUrl}/update/${id}`, BilansPeriodiquePrevu, { observe: 'response' });
}
}
